import React from 'react';

function LoginPage() {
    return (
        <div className="Login">
            <div className="Form">
                <h1>Login</h1>
                <input type="text"
                    placeholder="Email"></input>
                <input type="password" placeholder='Password'></input>
                <div className="buttons">
                    <button id='login'>Login</button>
                    <button id='register'>Register</button>
                </div>
            </div>
        </div>
    )
};


export default LoginPage;
